import React, { useEffect } from 'react';
import Login from './Auth/Login.tsx';
import { useNavigate } from 'react-router-dom';
import Button from './Button/index.tsx';
import styles from './home.module.css'
import { Container } from 'reactstrap';
import { Flex, Segmented } from 'antd';


function Home() {
  // cookie check???
  const isAuthenticated = true;

  const navigate = useNavigate();

  useEffect(() => {
    if (!isAuthenticated) {
      navigate('/login');
    }
  });

  return (
    <div>
      <Container>
        <h1>Электронная очередь</h1>
        <Flex gap="middle" align="start" vertical>
          <p>Select justify :</p>
          <Segmented options={justifyOptions} onChange={setJustify as SegmentedProps['onChange']} />
          <p>Select align :</p>
          <Segmented options={alignOptions} onChange={setAlignItems as SegmentedProps['onChange']} />
          <Flex style={boxStyle} justify={justify} align={alignItems}>
            <Button queue>Подача документов</Button>
            <Button queue>Подача документов</Button>
          </Flex>
        </Flex>

      </Container>
    </div>
  )
}

export default Home
